import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import Header from '../components/Header';
import Planet3D from '../components/Planet3D';
import Planet3DGLB from '../components/Planet3DGLB';
import './Home.css';

const Home: React.FC = () => {
  const [selectedPlanet, setSelectedPlanet] = useState<'moon' | 'jupiter'>('moon');
  const [planetSize, setPlanetSize] = useState(1);


  return (
    <div className="home">
      <Navbar />
      <Header />

      <section className="planet-section">
        <div className="container">
          <h2 className="section-title">Planeta 3D Interactivo</h2>
          <p className="section-description">
            Explora y personaliza tu propio planeta con diferentes configuraciones
          </p>

          <div className="planet-showcase">
            <div className="planet-display">
              <Planet3DGLB 
                planetType={selectedPlanet}
                size={planetConfig.size}
                rotationSpeed={planetConfig.rotationSpeed}
                autoRotate={true}
                shadowIntensity={planetConfig.shadowIntensity}
              />
            </div>

            <div className="planet-controls">
              <h3>Configuración del Planeta</h3>

              <div className="control-group">
                <label htmlFor="planetType">Planeta:</label>
                <select
                  id="planetType"
                  value={selectedPlanet}
                  onChange={(e) => setSelectedPlanet(e.target.value as 'moon' | 'jupiter')}
                >
                  <option value="moon">Luna</option>
                  <option value="jupiter">Júpiter</option>
                </select>
              </div>

              <div className="control-group">
                <label htmlFor="size">Tamaño: {planetConfig.size}</label>
                <input
                  type="range"
                  id="size"
                  min="0.5"
                  max="2"
                  step="0.1"
                  value={planetConfig.size}
                  onChange={(e) => handleConfigChange('size', parseFloat(e.target.value))}
                />
              </div>

              <div className="control-group">
                <label htmlFor="rotationSpeed">Velocidad de Rotación: {planetConfig.rotationSpeed}</label>
                <input
                  type="range"
                  id="rotationSpeed"
                  min="0"
                  max="3"
                  step="0.1"
                  value={planetConfig.rotationSpeed}
                  onChange={(e) => handleConfigChange('rotationSpeed', parseFloat(e.target.value))}
                />
              </div>

              <div className="control-group">
                <label htmlFor="shadowIntensity">Intensidad de Sombras: {planetConfig.shadowIntensity}</label>
                <input
                  type="range"
                  id="shadowIntensity"
                  min="0"
                  max="3"
                  step="0.1"
                  value={planetConfig.shadowIntensity}
                  onChange={(e) => handleConfigChange('shadowIntensity', parseFloat(e.target.value))}
                />
              </div>

              <div className="preset-buttons">
                <h4>Presets:</h4>
                <button 
                  onClick={() => setPlanetConfig({
                    size: 1,
                    rotationSpeed: 1,
                    shadowIntensity: 1
                  })}
                  className="preset-btn"
                >
                  Configuración Normal
                </button>
                <button 
                  onClick={() => setPlanetConfig({
                    size: 1.2,
                    rotationSpeed: 2,
                    shadowIntensity: 1.5
                  })}
                  className="preset-btn"
                >
                  Configuración Dinámica
                </button>
                <button 
                  onClick={() => setPlanetConfig({
                    size: 0.8,
                    rotationSpeed: 0.5,
                    shadowIntensity: 0.5
                  })}
                  className="preset-btn"
                >
                  Configuración Suave
                </button>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
